import React from 'react';
import { Modal, Button } from 'react-bootstrap';

const EditQRModal = ({ show, onHide, groupData, onQRUpdated }) => {
  return (
    <Modal show={show} onHide={onHide}>
      <Modal.Header closeButton>
        <Modal.Title>Editar Estado del QR</Modal.Title>
      </Modal.Header>
      <Modal.Body>
        {/* Implementa el formulario para editar QR */}
        <p>Formulario de edici√≥n de QR (por implementar).</p>
      </Modal.Body>
      <Modal.Footer>
        <Button variant="secondary" onClick={onHide}>Cerrar</Button>
        <Button variant="primary" onClick={() => onQRUpdated(true)}>Guardar</Button>
      </Modal.Footer>
    </Modal>
  );
};

export default EditQRModal;
